import React from 'react';

function Navbar(props){
    return (
        <nav className="navbar navbar-light bg-light justify-content-between">
            <a class="navbar-brand">CyptoCon</a>
            <input type="search" aria-label="Search" onChange={props.searchCoin} className="form-control mr-sm-2"/>
        </nav>
    )
}

export default Navbar
